import React from 'react';

function Home() {
  return (
    <div className="text-center">
      <h1>Bienvenido a Suriyaco Valley</h1>
      <p>Explorando las ciencias de la tierra con pasión y dedicación.</p>
    </div>
  );
}

export default Home;
